import React,{Component} from "react"

/* Initialize state*/

class MemeGenerator extends Component {
    constructor(){
        super()
        this.state = {
            topText : "" ,
            bottomText : "" ,
            randomImg : "https://imgflip.com/s/meme/Doge.jpg"
        }
    }

    render(){
        return(
            <h1 className="haha"> MEME GENERATOR SECTION </h1>
        )
    }
}


export default MemeGenerator
